Sinds FBI agente Gracie Hart (Sandra Bullock) undercover ging bij een missverkiezing, is ze een ware beroemdheid geworden. In 
plaats van achter de boeven aanrennen, rent ze nu heen en weer van haarsalon naar talkshow om haar boek te promoten. De FBI ziet 
haar als het nieuwe en aantrekkelijke boegbeeld van de organisatie. Maar wanneer haar goede vrienden Cheryl en Stan worden 
ontvoerd, kunnen ze Gracie niet weerhouden om opnieuw in de verkleedkist te duiken. En hoewel ze niet erg goed op kan schieten 
met haar vrouwelijke collega Sam, gaan ze samen undercover in de bruisende showstad Las Vegas.:
